style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("about:home") {
#snippetContainer
  {
     display:none !important;
  }
  
    html {
        background: -moz-linear-gradient(-90deg, #ddd9df, #dffefd) !important;
    }

    body {
        background: url(data:image/png;base64,) no-repeat center 14.5em !important;
        background-attachment:fixed !important;
    }
    #brandStart {
        background: url(data:image/png;base64,) center center no-repeat;
        height: 180px !important;
    }
    #brandStartLogo {
        visibility: hidden !important;
    }
    #brandStartSpacer {
        display: none !important;
    }
    #searchContainer {
        height: 0 !important;
        min-height:110px !important;
    }
    #searchForm {
        width: 100% !important;
    }
    #searchLogoContainer {
        width: 27% !important;
    }
    #searchEngineLogo {
        display:none;
    }
    #searchInputContainer {
        width: 41% !important;
    }
    #searchButtons {
        width: 34% !important;
    }
    #restorePreviousSession
    {
       color:rgb(100,100,100) !important;
    }
    #bottomSection {
        display:none;
    }
}
